In TypeScript, you can use the `extends` keyword to specify that a type is a subtype of another type, even if the type system doesn't know it in practice. This is known as a "narrower type" or an "assertion".

Here's an example:
```typescript
function foo(x: number | string): number {
  return x as number;
}
```
In this example, the type of `x` is `number | string`. However, we know that `foo` only accepts numbers, so we can assert that `x` is actually of type `number` using the `as` keyword:
```typescript
function foo(x: number | string): number {
  return x as number;
}

const y: number = foo("42"); // no error
```
In this example, TypeScript accepts the assertion and infers the type of `x` as `number` even though it could technically be a `string`.

Another way to express a narrower type is to use the `infer` keyword in a type assertion:
```typescript
type X = { a: number };
type Y = { a: string };

function foo(x: X | Y): X {
  return x as X;
}

const y: X = foo({ a: "hello" }); // error: '{"a": string}' is not of type '{"a": number}'
// but this works:
const y: X = foo(({ a }: X) => ({ a }));
```
In this example, we're asserting that `x` is of type `X`, even though it could technically be of type `Y`. TypeScript rejects this assertion, but we can work around it by using an inference expression to explicitly state that `x` is of type `X`.

Note that while assertions can be useful in certain situations, they should be used with caution, as they can lead to errors if you're not careful. It's generally better to structure your code in a way that makes the type system aware of the actual types involved.

