class Queue:
    def __init__(self):
        self.stack1 = []
        self.stack2 = []

    def is_empty(self):
        return self.stack1 == [] and self.stack2 == []

    def enqueue(self, item):
        self.stack2.append(item)

    def dequeue(self):
        if self.stack1 == [] and self.stack2 == []:
            return None
        if self.stack1 == []:
            self.stack1 = self.stack2
            self.stack2 = []
        return self.stack1.pop()

    def peek(self):
        if self.stack1 == [] and self.stack2 == []:
            return None
        if self.stack1 == []:
            return self.stack2[-1]
        return self.stack1[-1]

